import React from 'react'
import { Container, Card, Row, Col } from 'react-bootstrap'
const MovieOne = ({ data }) => {
    const title = data.list[0].page.title
    const contentitems = data.list[0].page["content-items"]
    const content = contentitems['content'];
    console.log(content)
    return (
        <div>
            <Container>
                <h4 className="m-0 py-3">{title}</h4>
            </Container>
            <hr className="m-0 mb-3" />
            <Container>
                <Row>
                    {content.map((items, index) => {
                        return (
                            <Col sm={3} key={index}>
                                <Card>
                                    <Card.Img src={'/Slice/' + items['poster-image']} />
                                    <Card.Body>
                                        <Card.Title>{items.name}</Card.Title>
                                    </Card.Body>
                                </Card>
                            </Col>

                        )
                    })}
                </Row>
                <pre>
                    {JSON.stringify(data)}
                </pre>
            </Container>
        </div>
    )
}

export default MovieOne
